import React from 'react'
import Todo from './Todo'
import "./styles.css";

interface Props {
    todos: Todo[]
    setTodos: React.Dispatch<React.SetStateAction<Todo[]>>
}

const TodoList:React.FunctionComponent<Props> = ({todos, setTodos}: Props) => {
  return (
    <div className='todos'>

    </div>
  )
}

export default TodoList
